create table t_lock
(
    id                 BIGINT(19) auto_increment
        primary key,
    lock_barcode       VARCHAR(255) null,
    sim_iccid_no       VARCHAR(255) null,
    mac_address        VARCHAR(255) null,
    authorization_code VARCHAR(255) null,
    creator            VARCHAR(255) null,
    create_time        BIGINT(19)   null,
    updater            VARCHAR(255) null,
    update_time        VARCHAR(255) null,
    is_use             VARCHAR(255) null
)
    collate = utf8_bin;

